import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Add multiple products to cart rapidly
    const productCards = await page.$$('.product-card');

    for (let i = 0; i < Math.min(3, productCards.length); i++) {
      const addToCartBtn = await productCards[i].$('.add-to-cart');
      if (addToCartBtn) {
        await addToCartBtn.click();
        // Minimal delay between actions for stress test
        await page.waitForTimeout(100);
      }
    }

    // Take screenshot after adding items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Take screenshot of cart with items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Rapidly remove all items from cart
    const removeButtons = await page.$$('.remove-item');

    for (const button of removeButtons) {
      await button.click();
      // Minimal delay between removals for stress test
      await page.waitForTimeout(100);
    }

    // Wait for empty cart state
    await page.waitForSelector('.empty-cart', { timeout: 5000 });

    // Take final screenshot of empty cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_empty.png'));

    // Extract cart count data
    const cartCount = await page.$eval('.cart-count', el => el.textContent.trim());
    const isEmpty = await page.$('.empty-cart') !== null;

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test - added and removed multiple items",
      extractedData: {
        finalCartCount: cartCount,
        cartIsEmpty: isEmpty,
        itemsProcessed: removeButtons.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
